import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.js';
import './index.css';
import * as serviceWorker from './serviceWorker';

import Fruits from './Fruits/Fruits.js';

import logo from './logo.svg';
import './App.css'; 


function Hello(){
  return (
	<div>
		<h1>Hello React </h1>
		<ul>
			<li>Rahel</li>
			<li>Hikma</li>
			<li>Jemila</li>
		</ul>
	</div>
  );
}

